import React, { Component } from 'react';

class CreateEmployeeComponent extends Component {

    constructor(props){
        super(props)

        this.state = {

            firstName: "",
            lastNAme: "",
            emailAddress: ""

        }
    }

    render() {
        return (
            <div>
                <div className='container'>
                    <div className='row'>
                        <div className='card col-md-6 offset-md-3 offset-md-3 offset-md-3'>
                            <h3 className='text-center'>Add new Employee</h3>
                                <div className='card-body'>
                                    <form action="">
                                        <div className='form-group'>
                                            <label>First Name:</label>
                                            <input type="text" placeholder='First Name' className='form-control' 
                                            name='firstName' value={this.state.firstName}  />
                                        </div>
                                        <div>
                                            <label>Last Name:</label>
                                            <input type="text" placeholder='Last Name' className='form-control' name='lastName' value={this.state.lastNA} />
                                        </div>
                                        <div>
                                            <label>Email Address:</label>
                                            <input type="email" placeholder='Last Name' className='form-control' name='lastName' />
                                        </div>
                                        <button type='submit' className='btn btn-primary'>Save</button>
                                    </form>
                                </div>
                        </div>

                    </div>


                </div>
            </div>
        );
    }
}

export default CreateEmployeeComponent;
